interop/ports.html.body:
Ports
Ports allow communication between Elm and JavaScript.
Ports are probably most commonly used for WebSockets and localStorage. Let's focus on the WebSockets example.
Ports in JavaScript
Here we have pretty much the same HTML we have been using on the previous pages, but with a bit of extra JavaScript code in there. We create a connection to wss://echo.websocket.org that just repeats back whatever you send it. You can see in the live example that this lets us make the skeleton of a chat room:




    Elm + Websockets








    // Start the Elm application.
    var app = Elm.Main.init({
      node: document.getElementById("myapp"),
    });

    // Create your WebSocket.
    var socket = new WebSocket("wss://echo.websocket.org");

    // When a command goes to the `sendMessage` port, we pass the message
    // along to the WebSocket.
    app.ports.sendMessage.subscribe(function (message) {
      socket.send(message);
    });

    // When a message comes into our WebSocket, we pass the message along
    // to the `messageReceiver` port.
    socket.addEventListener("message", function (event) {
      app.ports.messageReceiver.send(event.data);
    });

    // If you want to use a JavaScript library to manage your WebSocket
    // connection, replace the code in JS with the alternate implementation.



We call Elm.Main.init() like in all of our interop examples, but this time we are actually using the resulting app object. We are subscribing to the sendMessage port and we are sending to the messageReceiver port.
Those correspond to code written on the Elm side.
Ports in Elm
Check out the lines that use the port keyword in the corresponding Elm file. This is how we define the ports that we just saw on the JavaScript side.
port module Main exposing (..)

import Browser
import Html exposing (..)
import Html.Attributes exposing (..)
import Html.Events exposing (..)
import Json.Decode as D



-- MAIN


main : Program () Model Msg
main =
    Browser.element
        { init = init
        , view = view
        , update = update
        , subscriptions = subscriptions
        }



-- PORTS


port sendMessage : String -> Cmd msg


port messageReceiver : (String -> msg) -> Sub msg



-- MODEL


type alias Model =
    { draft : String
    , messages : List String
    }


init : () -> ( Model, Cmd Msg )
init flags =
    ( { draft = "", messages = [] }
    , Cmd.none
    )



-- UPDATE


type Msg
    = DraftChanged String
    | Send
    | Recv String



-- Use the `sendMessage` port when someone presses ENTER or clicks
-- the "Send" button. Check out index.html to see the corresponding
-- JS where this is piped into a WebSocket.


update : Msg -> Model -> ( Model, Cmd Msg )
update msg model =
    case msg of
        DraftChanged draft ->
            ( { model | draft = draft }
            , Cmd.none
            )

        Send ->
            ( { model | draft = "" }
            , sendMessage model.draft
            )

        Recv message ->
            ( { model | messages = model.messages ++ [ message ] }
            , Cmd.none
            )



-- SUBSCRIPTIONS
--
-- Subscribe to the `messageReceiver` port to hear about messages coming in
-- from JS. Check out the index.html file to see how this is hooked up to a
-- WebSocket.


subscriptions : Model -> Sub Msg
subscriptions _ =
    messageReceiver Recv



-- VIEW


view : Model -> Html Msg
view model =
    div []
        [ h1 [] [ text "Echo Chat" ]
        , ul []
            (List.map (\msg -> li [] [ text msg ]) model.messages)
        , input
            [ type_ "text"
            , placeholder "Draft"
            , onInput DraftChanged
            , on "keydown" (ifIsEnter Send)
            , value model.draft
            ]
            []
        , button [ onClick Send ] [ text "Send" ]
        ]



-- DETECT ENTER


ifIsEnter : msg -> D.Decoder msg
ifIsEnter msg =
    D.field "key" D.string
        |> D.andThen
            (\key ->
                if key == "Enter" then
                    D.succeed msg

                else
                    D.fail "some other key"
            )

Notice that the first line says port module rather than just module. This makes it possible to define ports in a given module. The compiler gives a hint about this if it is needed, so hopefully no one gets too stuck on that!
Okay, but what is going on with the port declarations for sendMessage and messageReceiver?
Outgoing Messages (Cmd)
The sendMessage declaration lets us send messages out of Elm.
port sendMessage : String -> Cmd msg

Here we are declaring that we want to send out String values, but we could send out any of the types that work with flags. We talked about those types on the previous page, and you can check out this localStorage example to see a Json.Encode.Value getting sent out to JavaScript.
From there we can use sendMessage like any other function. If your update function produces a sendMessage "hello" command, you will hear about it on the JavaScript side:
app.ports.sendMessage.subscribe(function (message) {
  socket.send(message);
});

This JavaScript code is subscribed to all of the outgoing messages. You can subscribe multiple functions and unsubscribe functions by reference, but we generally recommend keeping things static.
We also recommend sending out richer messages, rather than making lots of individual ports. Maybe that means having a custom type in Elm that represents everything you might need to tell JS, and then using Json.Encode to send it out to a single JS subscription. Many people find that this creates a cleaner separation of concerns. The Elm code clearly owns some state, and the JS clearly owns other state.
Incoming Messages (Sub)
The messageReceiver declaration lets us listen for messages coming in to Elm.
port messageReceiver : (String -> msg) -> Sub msg

We are saying we are going to receive String values, but again, we can listen for any type that can come in through flags or outgoing ports. Just swap out the String type with one of the types that can cross the border.
Again we can use messageReceiver like any other function. In our case we call messageReceiver Recv when defining our subscriptions because we want to hear about any incoming messages from JavaScript. This will let us get messages like Recv "how are you?" in our update function.
On the JavaScript side, we are able to send things to this port whenever we want:
socket.addEventListener("message", function (event) {
  app.ports.messageReceiver.send(event.data);
});

We happen to be sending whenever the websocket gets a message, but you could send at other times as well. Maybe we are getting messages from another data source as well. That is fine, and Elm does not need to know anything about it! Just send the strings through the relevant port.
Notes
Ports are about creating strong boundaries! Definitely do not try to make a port for every JS function you need. You may really like Elm and want to do everything in Elm no matter the cost, but ports are not designed for that. Instead, focus on questions like “who owns the state?” and use one or two ports to send messages back and forth. If you are in a complex scenario, you can even simulate Msg values by sending JS like { tag: "active-users-changed", list: ... } where you have a tag for all the variants of information you might send across.
Here are some simple guidelines and common pitfalls:

Sending Json.Encode.Value through ports is recommended. Like with flags, certain core types can pass through ports as well. This is from the time before JSON decoders, and you can read about it more here.

All port declarations must appear in a port module. It is probably best to organize all your ports into one port module so it is easier to see the interface all in one place.

Ports are for applications. A port module is available in applications, but not in packages. This ensures that application authors have the flexibility they need, but the package ecosystem is entirely written in Elm. We think this will create a stronger ecosystem and community in the long run, and we get into the tradeoffs in depth in the upcoming section on the limits of Elm/JS interop.

Ports can be dead code eliminated. Elm has quite aggressive dead code elimination, and it will remove ports that are not used within Elm code. The compiler does not know what goes on in JavaScript, so try to hook things up in Elm before JavaScript.


I hope this information will help you find ways to embed Elm in your existing JavaScript! It is not as glamorous as doing a full-rewrite in Elm, but history has shown that it is a much more effective strategy.

interop/custom_elements.html.body:
Custom Elements
On the last few pages, we have seen (1) how to start Elm programs from JavaScript, (2) how to pass data in as flags on initialization, and (3) how to send messages between Elm and JS with ports. But guess what people? There is another way to do interop!
Browsers seem to be supporting custom elements more and more, and that turns out to be quite helpful for embedding JS into Elm programs.
Here is a minimal example of how to use custom elements to do some localization and internationalization.
Creating Custom Elements
Say we want to localize dates, but that is not accessible in Elm core packages yet. Maybe you want to write a function that localizes dates:
//
//   localizeDate('sr-RS', 12, 5) === "петак, 1. јун 2012."
//   localizeDate('en-GB', 12, 5) === "Friday, 1 June 2012"
//   localizeDate('en-US', 12, 5) === "Friday, June 1, 2012"
//
function localizeDate(lang, year, month) {
  const dateTimeFormat = new Intl.DateTimeFormat(lang, {
    weekday: "long",
    year: "numeric",
    month: "long",
    day: "numeric",
  });

  return dateTimeFormat.format(new Date(year, month));
}

But how do we use that in Elm?! Newer browsers allow you to create new types of DOM nodes like this:
//
//   
//   
//   
//
customElements.define(
  "intl-date",
  class extends HTMLElement {
    // things required by Custom Elements
    constructor() {
      super();
    }
    connectedCallback() {
      this.setTextContent();
    }
    attributeChangedCallback() {
      this.setTextContent();
    }
    static get observedAttributes() {
      return ["lang", "year", "month"];
    }

    // Our function to set the textContent based on attributes.
    setTextContent() {
      const lang = this.getAttribute("lang");
      const year = this.getAttribute("year");
      const month = this.getAttribute("month");
      this.textContent = localizeDate(lang, year, month);
    }
  },
);

The most important parts here are attributeChangedCallback and observedAttributes. You need some logic like that to detect changes to the attributes you care about.
Load that before you initialize your Elm code, and you will be able to write code like this in Elm:
import Html exposing (Html, node)
import Html.Attributes exposing (attribute)


viewDate : String -> Int -> Int -> Html msg
viewDate lang year month =
    node "intl-date"
        [ attribute "lang" lang
        , attribute "year" (String.fromInt year)
        , attribute "month" (String.fromInt month)
        ]
        []

Now you can call viewDate when you want access to that kind of localized information in your view.
You can check out the full version of this example here.
More Info
Luke has a lot more experience with custom elements, and I think his Elm Europe talk is an excellent introduction!
undefined
Docs on custom elements can be kind of confusing, but I hope this is enough for people to get started embedding simple logic for Intl or even large React widgets if that seems like the right choice for your project.

core_language.html.body:
Lo esencial del lenguaje
Intentemos primero construir una intuición sobre cómo funciona Elm.
El objetivo es familiarizarnos con valores y funciones, y tomar confianza para cuando nos enfrentemos a ejemplos más largos de código.
Valores
La unidad más básica en Elm se llama un valor. Todos estos son valores: 42, True, "¡Hola!".
Veamos primero los números.


[
    {
        "input": "1 + 1",
        "value": "\u001b[95m2\u001b[0m",
        "type_": "number"
    }
]


Todos los ejemplos en esta página son interactivos. Si apretas sobre esta caja negra ⬆️ vas a ver que el cursor de texto va a empezar a pestañear. Escribe 2 + 2 y apreta ENTER. Deberías ver que aparece 4 como resultado. Recuerda que puedes interactuar de la misma forma con todos los demás ejemplos en este documento.
Prueba escribir algo como 30 * 60 * 1000 o 2 ^ 4. Verás que funciona igual que una calculadora.
Está bien hacer aritmética, pero es algo sorprendentemente poco común en la mayoría de programas que uno escribe. Es mucho más frecuente manipular textos, lo que en informática se llama técnicamente string. Algo así:


[
    {
        "input": "\"hello\"",
        "value": "\u001b[93m\"hello\"\u001b[0m",
        "type_": "String"
    },
    {
        "input": "\"butter\" ++ \"fly\"",
        "value": "\u001b[93m\"butterfly\"\u001b[0m",
        "type_": "String"
    }
]


Prueba unir varios strings con el operador (++) ⬆️
Estos valores primitivos se vuelven más interesantes a medida que escribamos funciones para transformarlos.

Nota: Puedes leer más sobre distintos operadores, como (+), (/) y (++) en la documentación del módulo Basics. Lamentablemente, esta documentación está en inglés, pero está escrita en un lenguaje muy poco técnico, y aunque sea con traducción automática, creo que vale la pena darle una leída una vez que te parezca apropiado.

Funciones
Una función es una forma de transformar valores. Éstas toman algunos valores, y producen un nuevo valor.
Por ejemplo, esta es una función greet que recibe un nombre y dice “hola”:


[
    {
        "add-decl": "greet",
        "input": "greet name =\n  \"Hello \" ++ name ++ \"!\"\n",
        "value": "\u001b[36m\u001b[0m",
        "type_": "String -> String"
    },
    {
        "input": "greet \"Alice\"",
        "value": "\u001b[93m\"Hello Alice!\"\u001b[0m",
        "type_": "String"
    },
    {
        "input": "greet \"Bob\"",
        "value": "\u001b[93m\"Hello Bob!\"\u001b[0m",
        "type_": "String"
    }
]


Trata saludar a alguna otra persona, como a "Stokely" o a "Kwame" ⬆️
Los valores que le pasas a la función se suelen llamar argumentos, así que podríamos decir que greet es una función que recibe un argumento.
Bien, ahora que terminamos las formalidades, ¿qué te parece si probamos una función madlib que recibe dos argumentos?


[
    {
        "add-decl": "madlib",
        "input": "madlib animal adjective =\n  \"The ostentatious \" ++ animal ++ \" wears \" ++ adjective ++ \" shorts.\"\n",
        "value": "\u001b[36m\u001b[0m",
        "type_": "String -> String -> String"
    },
    {
        "input": "madlib \"cat\" \"ergonomic\"",
        "value": "\u001b[93m\"The ostentatious cat wears ergonomic shorts.\"\u001b[0m",
        "type_": "String"
    },
    {
        "input": "madlib (\"butter\" ++ \"fly\") \"metallic\"",
        "value": "\u001b[93m\"The ostentatious butterfly wears metallic shorts.\"\u001b[0m",
        "type_": "String"
    }
]


Intenta darle dos argumentos a la función madlib ⬆️
Observa que usamos paréntesis para agrupar "butter" ++ "fly" en el segundo ejemplo. Cada argumento necesita ser un valor primitivo, como "gato", y si no, necesitas usar paréntesis.

Nota: Si estás habituado a lenguajes como JavaScript, te puede sorprender que las funciones se ven distintas:
madlib "cat" "ergonomic"                  -- Elm
madlib("cat", "ergonomic")                // JavaScript

madlib ("butter" ++ "fly") "metallic"      -- Elm
madlib("butter" + "fly", "metallic")       // JavaScript
Te puede parecer raro al principio, pero para este estilo necesitamos usar menos paréntesis y comas. Cuando te acostumbres vas a ver que el lenguaje se siente más simple y limpio.

Expresiones if
Cuando necesitas comportamiento condicional en Elm, puedes usar una expresión if.
Creemos una nueva función greet que es adecuadamente respetuosa con el expresidente Abraham Lincoln.


[
    {
        "add-decl": "greet",
        "input": "greet name =\n  if name == \"Abraham Lincoln\" then\n    \"Greetings Mr. President!\"\n  else\n    \"Hey!\"\n",
        "value": "\u001b[36m\u001b[0m",
        "type_": "String -> String"
    },
    {
        "input": "greet \"Tom\"",
        "value": "\u001b[93m\"Hey!\"\u001b[0m",
        "type_": "String"
    },
    {
        "input": "greet \"Abraham Lincoln\"",
        "value": "\u001b[93m\"Greetings Mr. President!\"\u001b[0m",
        "type_": "String"
    }
]


Probablemente hay más casos que podríamos cubrir, pero por ahora, con esto basta.
Listas
Las listas son unas de las estructuras de datos más comunes en Elm. Sirven para albergar una secuencia de cosas relacionadas, similar a los “arrays” en JavaScript.
Una lista puede contener muchos valores. Dichos valores deben tener todos el mismo tipo. Aquí tienes algunos ejemplos que usan funciones del módulo List:


[
    {
        "add-decl": "names",
        "input": "names =\n  [ \"Alice\", \"Bob\", \"Chuck\" ]\n",
        "value": "[\u001b[93m\"Alice\"\u001b[0m,\u001b[93m\"Bob\"\u001b[0m,\u001b[93m\"Chuck\"\u001b[0m]",
        "type_": "List String"
    },
    {
        "input": "List.isEmpty names",
        "value": "\u001b[96mFalse\u001b[0m",
        "type_": "Bool"
    },
    {
        "input": "List.length names",
        "value": "\u001b[95m3\u001b[0m",
        "type_": "String"
    },
    {
        "input": "List.reverse names",
        "value": "[\u001b[93m\"Chuck\"\u001b[0m,\u001b[93m\"Bob\"\u001b[0m,\u001b[93m\"Alice\"\u001b[0m]",
        "type_": "List String"
    },
    {
        "add-decl": "numbers",
        "input": "numbers =\n  [4,3,2,1]\n",
        "value": "[\u001b[95m4\u001b[0m,\u001b[95m3\u001b[0m,\u001b[95m2\u001b[0m,\u001b[95m1\u001b[0m]",
        "type_": "List number"
    },
    {
        "input": "List.sort numbers",
        "value": "[\u001b[95m1\u001b[0m,\u001b[95m2\u001b[0m,\u001b[95m3\u001b[0m,\u001b[95m4\u001b[0m]",
        "type_": "List number"
    },
    {
        "add-decl": "increment",
        "input": "increment n =\n  n + 1\n",
        "value": "\u001b[36m\u001b[0m",
        "type_": "number -> number"
    },
    {
        "input": "List.map increment numbers",
        "value": "[\u001b[95m5\u001b[0m,\u001b[95m4\u001b[0m,\u001b[95m3\u001b[0m,\u001b[95m2\u001b[0m]",
        "type_": "List number"
    }
]


Prueba construir tu propia lista, y usa funciones como List.length ⬆️
¡Recuerda que todos los elementos de la lista deben siempre tener el mismo tipo!
Tuplas
Las tuplas son otra estructura de datos muy útil. Una tupla puede contener dos o tres valores, y cada valor puede tener cualquier tipo. Un uso común es para devolver más de un valor desde una función. La siguiente función recibe un nombre y devuelve un mensaje al usuario:


[
    {
        "add-decl": "isGoodName",
        "input": "isGoodName name =\n  if String.length name \u001b[0m",
        "type_": "String -> ( Bool, String )"
    },
    {
        "input": "isGoodName \"Tom\"",
        "value": "(\u001b[96mTrue\u001b[0m, \u001b[93m\"name accepted!\"\u001b[0m)",
        "type_": "( Bool, String )"
    }
]


Es una estructura muy útil, pero cuando las cosas se ponen más complicadas, es mejor usar registros en vez de tuplas.
Registros
Un registro puede contener muchos valores, y cada valor lleva un nombre asociado.
Este es un registro que representa al economista inglés John A. Hobson:


[
    {
        "add-decl": "john",
        "input": "john =\n  { first = \"John\"\n  , last = \"Hobson\"\n  , age = 81\n  }\n",
        "value": "{ \u001b[37mage\u001b[0m = \u001b[95m81\u001b[0m, \u001b[37mfirst\u001b[0m = \u001b[93m\"John\"\u001b[0m, \u001b[37mlast\u001b[0m = \u001b[93m\"Hobson\"\u001b[0m }",
        "type_": "{ age : number, first : String, last : String }"
    },
    {
        "input": "john.last",
        "value": "\u001b[93m\"Hobson\"\u001b[0m",
        "type_": "String"
    }
]


Definimos un registro con tres campos que contienen información sobre John, específicamente su nombre y edad.
Prueba recuperar otros campos del registro, como john.age ⬆️
También puedes recuperar campos de un registro usando funciones de acceso:


[
    {
        "add-decl": "john",
        "input": "john = { first = \"John\", last = \"Hobson\", age = 81 }",
        "value": "{ \u001b[37mage\u001b[0m = \u001b[95m81\u001b[0m, \u001b[37mfirst\u001b[0m = \u001b[93m\"John\"\u001b[0m, \u001b[37mlast\u001b[0m = \u001b[93m\"Hobson\"\u001b[0m }",
        "type_": "{ age : number, first : String, last : String }"
    },
    {
        "input": ".last john",
        "value": "\u001b[93m\"Hobson\"\u001b[0m",
        "type_": "String"
    },
    {
        "input": "List.map .last [john,john,john]",
        "value": "[\u001b[93m\"Hobson\"\u001b[0m,\u001b[93m\"Hobson\"\u001b[0m,\u001b[93m\"Hobson\"\u001b[0m]",
        "type_": "List String"
    }
]


También es útil actualizar valores en un registro:


[
    {
        "add-decl": "john",
        "input": "john = { first = \"John\", last = \"Hobson\", age = 81 }",
        "value": "{ \u001b[37mage\u001b[0m = \u001b[95m81\u001b[0m, \u001b[37mfirst\u001b[0m = \u001b[93m\"John\"\u001b[0m, \u001b[37mlast\u001b[0m = \u001b[93m\"Hobson\"\u001b[0m }",
        "type_": "{ age : number, first : String, last : String }"
    },
    {
        "input": "{ john | last = \"Adams\" }",
        "value": "{ \u001b[37mage\u001b[0m = \u001b[95m81\u001b[0m, \u001b[37mfirst\u001b[0m = \u001b[93m\"John\"\u001b[0m, \u001b[37mlast\u001b[0m = \u001b[93m\"Adams\"\u001b[0m }",
        "type_": "{ age : number, first : String, last : String }"
    },
    {
        "input": "{ john | age = 22 }",
        "value": "{ \u001b[37mage\u001b[0m = \u001b[95m22\u001b[0m, \u001b[37mfirst\u001b[0m = \u001b[93m\"John\"\u001b[0m, \u001b[37mlast\u001b[0m = \u001b[93m\"Hobson\"\u001b[0m }",
        "type_": "{ age : number, first : String, last : String }"
    }
]


Si intentamos leer en voz alta las expresiones de arriba, diríamos algo como “Quiero una versión de John cuyo apellido es Adams”, o “cuya edad es 22”.
Nótese que al actualizar los campos de john, estamos creando un registro completamente nuevo. El registro original no ha sido sobreescrito. Elm permite hacer esto en forma eficiente, compartiendo todo lo que pueda entre ambos. Si actualizas uno en diez campos, el nuevo registro va a compartir los otros nueve.
Dicho esto, una función que actualiza la edad quedaría así:


[
    {
        "add-decl": "celebrateBirthday",
        "input": "celebrateBirthday person =\n  { person | age = person.age + 1 }\n",
        "value": "\u001b[36m\u001b[0m",
        "type_": "{ a | age : number } -> { a | age : number }"
    },
    {
        "add-decl": "john",
        "input": "john = { first = \"John\", last = \"Hobson\", age = 81 }",
        "value": "{ \u001b[37mage\u001b[0m = \u001b[95m81\u001b[0m, \u001b[37mfirst\u001b[0m = \u001b[93m\"John\"\u001b[0m, \u001b[37mlast\u001b[0m = \u001b[93m\"Hobson\"\u001b[0m }",
        "type_": "{ age : number, first : String, last : String }"
    },
    {
        "input": "celebrateBirthday john",
        "value": "{ \u001b[37mage\u001b[0m = \u001b[95m82\u001b[0m, \u001b[37mfirst\u001b[0m = \u001b[93m\"John\"\u001b[0m, \u001b[37mlast\u001b[0m = \u001b[93m\"Hobson\"\u001b[0m }",
        "type_": "{ age : number, first : String, last : String }"
    }
]


Actualizar campos en registros es algo muy común, así que vamos a ver muchos más ejemplos en la próxima sección.
